<span class="line"><span style="color:#F8F8F2;">demo1.girl.</span><span style="color:#50FA7B;">push</span><span style="color:#F8F8F2;">(</span><span style="color:#BD93F9;">6</span><span style="color:#F8F8F2;">)</span></span>
